def simulate_model(trial_data, self_interest_weight=1, relative_advantage_weight=1, risk_aversion=1):
    utility_values = []
    for trial in trial_data:
        split_self = trial.get("split_self", 0)
        split_opp = trial.get("split_opp", 0)
        token_self = trial.get("token_self", 1) #Avoid division by zero
        token_opp = trial.get("token_opp", 1) #Avoid division by zero
        trial_type_modifier = trial.get("trial_type",1)

        #Handle potential division by zero errors
        if token_opp == 0:
          relative_advantage_term = 0
        else:
          relative_advantage_term = (split_self - split_opp) * (token_self / token_opp) * trial_type_modifier

        if token_self + token_opp == 0:
          risk_aversion_term = 0
        else:
          risk_aversion_term = risk_aversion * (token_self/(token_self+token_opp)) * (split_self - split_opp)

        utility = self_interest_weight * split_self + relative_advantage_weight * relative_advantage_term + risk_aversion_term
        utility_values.append(utility)
    return utility_values
